// Ordem das categorias
export const categoryOrder = [
    'TV Aberta',
    'Filmes',
    'Series',
    'Esportes',
    'Noticias',
    'Infantil',
    'Documentarios',
    'Entretenimento',
    'Musica',
    'Internacionais',
    'Adulto',
];

// Ordena canais alfabeticamente dentro de cada categoria
const sortedByCategory = [...rawChannels].sort((a, b) => {
    const catIndexA = categoryOrder.indexOf(a.category);
    const catIndexB = categoryOrder.indexOf(b.category);
    if (catIndexA !== catIndexB) return catIndexA - catIndexB;
    return a.name.localeCompare(b.name, 'pt-BR');
});

// Adiciona número do canal + logo fallback
const allChannels: Channel[] = sortedByCategory.map((channel, index) => ({
    ...channel,
    channelNumber: index + 1,
    logo: channel.logo || getFallbackLogo(channel.name),
}));

// Canais públicos (sem adulto)
export const channels: Channel[] = allChannels.filter(ch => ch.category !== 'Adulto');

// Canais adultos
export const adultChannels: Channel[] = allChannels.filter(ch => ch.category === 'Adulto');

// Função para obter todos os canais
export const getAllChannels = (includeAdult: boolean): Channel[] => {
    if (includeAdult) {
        return allChannels;
    }
    return channels;
};

// Obter canais por categoria
export const getChannelsByCategory = (category: string, includeAdult: boolean): Channel[] => {
    const allChs = getAllChannels(includeAdult);
    if (category === 'Todos') return allChs;
    return allChs.filter(ch => ch.category === category);
};

// Obter canal por ID
export const getChannelById = (id: string): Channel | undefined => {
    return allChannels.find(ch => ch.id === id);
};
